import styled from "styled-components";

export const logo = styled.h1`
  width: 139px;
  height: 17px;
  left: 25px;
  top: 43px;

  /* logo */

  font-family: "Roboto";
  font-style: normal;
  font-weight: 800;
  font-size: 36px;
  line-height: 17px;
  /* identical to box height, or 47% */

  display: flex;
  align-items: flex-end;
  text-transform: uppercase;

  color: rgba(0, 0, 0, 0.8);
`;
